import jspreadsheet from "jspreadsheet";

var mySpreadsheet = jspreadsheet(document.getElementById("spreadsheet"), {
  csv: "test.csv",
  csvHeaders: true,
  tableOverflow: false,
  pagination: 10,
  search: true,
  title: "circuits",
  columns: [
    { type: "text", width: 80 },
    { type: "text", width: 945, wordWrap: true },
    { type: "text", width: 60 },
    { type: "text", width: 80 },
    { type: "text", width: 80 },
    { type: "text", width: 60 },
    { type: "text", width: 80 },
    { type: "text", width: 80 },
    { type: "text", width: 80 },
    { type: "text", width: 80 },
  ],
});
